export function main(_data : Array<any>)
{   
    return "RoomStart";
}
export function RoomStart(_data : Array<any>)
{
    CModal.FindModal("StartBtn").Open();
    return "RoomUpdate";
}
export function RoomUpdate(_data : Array<any>)
{
    if(CEvent.eType.Click==(CModal.FindModal("StartBtn") as CModalEvent).GetState())
        return "GameStart";
    return null;
}
export function GameStart(_data : Array<any>)
{
    CModal.FindModal("StartBtn").Close();
    return "GameUpdate";
}
